content:
&#x27;끊자.
극한까지 컨트롤해서~!&#x27;

한화를 마무리하는 작가의 마음인가?

&quot;떠 올려봐. 내가 처음 너에게 다가갔던날, 내게 했던 말들을&quot;
대답으로 알맞은 것을 고르시오
1. &quot;....... 뭐였지?&quot;
2. &quot;뭐라고?  안들려&quot;
3. &quot;저.. 저 녀석. 정신공격이냐? 그만! 떠올리니 손발이 오그라들어 죽을거 같아&quot;
4. &quot;앗흥.. 무..문식아 (발그레)&quot;

한게임으로 얼마나 우린겁니까;
이러시면 정말 오~예입니다
너무 재밋어요ㅜㅜ 이 웹툰은 진짜 오래 연재햇으면 좋겠다..

정윤이 마지막 대사를 거꾸로하면 답이 나오는거 같네요.

&quot;서브의 순서와 코스를 전부 재조합해도..&quot;
&quot;서브를 전부 받아칠수 있다면...&quot;

결국은 피지컬과 순수한 테니스 실력

아....~~~~~~~~~ 작가님 아;;;
이렇게 끝으시면 어떻게 기다리라고... 자비점여
ㅠㅜ

너무 재미있게 보는웹툰중 하나인데
갑자기 전개가..움..;;
뜬금없이 테니스의왕자 느낌이나는데요?;;

판타지는 좀 아닌거같습니다..초심찾아주세요ㅠㅠ

이번화를 보고 느꼈다. 이 작가는 천재다.과거 천재들을 보고 있는 평범한 사람들이 말한 &quot;이 사람과 같은 시대에 살고 있는게 행운입니다.&quot;
이 말이 이해가 간다. 몇개의 단어 조합과 충분한 그림으로 독자를 완전히 몰입시키고 감정을 일으키는 힘.
이 만화에는 이게 있다.

이런 주신이에게 쓸 수 있는 명언이 있지요. 
 &quot;됐고, 주신아, 쫌 맞자! 맞고 시작해야겠다.&quot; 
주인공이지만.... 싹아지는... 없.... ;;
